import React,{Component,createRef} from 'react';
import Header from '../../common/component/header';
let arrImg=[require('../../common/img/tab/img1.png'),require('../../common/img/tab/img2.png'),require('../../common/img/tab/img3.png'),require('../../common/img/tab/img4.png')]
export default class Home extends Component{
    constructor(props){
        super(props);
        this.Div=createRef();
    }
    componentDidMount(){
        
    }
    render(){
        let y=arrImg.map(function(item){
            return <img src={item} alt='' key={Math.random()}/>
        })
        return(
            <div>
               <Header/>
               <div className='box'>
                    <div className='box-wai'>
                        <div className='box-wai-i' ref={this.Div}>
                            {y}
                        </div>
                    </div>
               </div>
            </div>
        )
    }
}
